To create a web application using React, Node.js, and Express.js, you'll need to set up a few things. Here's a step-by-step guide:

1. Set up the project structure:

Create a new directory for your project and navigate into it:
```
mkdir my-app
cd my-app
```

2. Set up the backend with Node.js and Express.js:

Initialize a new Node.js project and install Express.js:
```
npm init -y
npm install express
```

Create a new file called `server.js` and add the following code:
```javascript
const express = require('express');
const app = express();
const port = process.env.PORT || 5000;

app.use(express.json());

// Add your routes here

app.listen(port, () => {
  console.log(`Server is running on port ${port}`);
});
```

3. Set up the frontend with React:

Create a new React app using `create-react-app`:
```
npx create-react-app client
```

Navigate into the `client` directory and install Axios to make HTTP requests:
```
cd client
npm install axios
```

4. Create dummy data:

You can create dummy data in your `server.js` file or in a separate file. Here's an example of creating dummy data in `server.js`:
```javascript
let data = [
  { id: 1, name: 'John Doe', age: 30 },
  { id: 2, name: 'Jane Doe', age: 28 },
  // Add more dummy data here
];
```

5. Add routes to your Express.js server:

Add the following code to `server.js` to create routes for adding and retrieving data:
```javascript
// Add data
app.post('/api/data', (req, res) => {
  const newData = req.body;
  data.push(newData);
  res.json(newData);
});

// Get data
app.get('/api/data', (req, res) => {
  res.json(data);
});
```

6. Make HTTP requests from your React app:

In your React app, you can use Axios to make HTTP requests to your Express.js server. Here's an example of fetching data from the server:
```javascript
import React, { useState, useEffect } from 'react';
import axios from 'axios';

function App() {
  const [data, setData] = useState([]);

  useEffect(() => {
    fetchData();
  }, []);

  const fetchData = async () => {
    const response = await axios.get('/api/data');
    setData(response.data);
  };

  // Add more code here to display the data

  return (
    // Add your JSX here
  );
}

export default App;
```

7. Deploy your code:

To deploy your code, you'll need to build your React app and set up a server to host it. Here are the steps:

a. Build your React app:
```
cd client
npm run build
```

b. Copy the built files to your Express.js server:
```
cp -R build ..
```

c. Serve the built files from your Express.js server:

Add the following code to `server.js`:
```javascript
app.use(express.static(path.join(__dirname, 'build')));

app.get('/*', (req, res) => {
  res.sendFile(path.join(__dirname, 'build', 'index.html'));
});
```

